	(735, 'yyy9', '2021-06-17', '저는 학원에 다니면서 한순간도 프로그래밍을 하지 않은 적이 없습니다.', '저는 학원에 다니면서 한순간도 프로그래밍을 하지 않은 적이 없습니다.\r\n저는 코딩을 안 한 거지 프로그래밍을 안 한건 아닙니다.\r\n코딩을 하는 것과 프로그래밍을 하는 것은 다릅니다.', 4, 5, 1),
	(736, 'yyy10', '2021-06-17', '저는 학원에 다니면서 한순간도 프로그래밍을 하지 않은 적이 없습니다.', '저는 학원에 다니면서 한순간도 프로그래밍을 하지 않은 적이 없습니다.\r\n저는 코딩을 안 한 거지 프로그래밍을 안 한건 아닙니다.\r\n코딩을 하는 것과 프로그래밍을 하는 것은 다릅니다.', 2, 5, 1),
	(778, 'admin', '2021-06-28', '몇 개월 과정인가요?', '교육기간 및 시간은 과정마다 약간의 차이가 있으니, 자세한 안내는 대표번호로 문의주시면 감사하겠습니다.(☎02-479-4050)', 0, 8, 1),
	(779, 'admin', '2021-06-28', '정말로 전액 무료인가요?', '네, 고용노동부에서 \'국가기간전략산업직종훈련\'으로 지정한 게임 교육 과정으로 전액 무료입니다. 또한 최대 500만원의 훈련장려금이 국가 지원으로 지급됩니다. (매월 30~50만원씩 교통비와 식비로 연수비 지원, 교재도 무료 지원) 보통의 게임 학원들은 자부담금이 높은 전액 유료에 가격도 높지만, 유료 학원에서 실시하는 국비 지원 과정의 경우는 전액 무료가 아닌 절반은 본인 부담, 절반은 국비 지원인 경우가 대부분 입니다.', 0, 8, 1),
	(780, 'admin', '2021-06-28', '생각은 있는데 지원하기가 망설여집니다.', '온라인 문의 게시판이나 전화 상담, 카카오톡 플러스친구 상담(ID:경일게임아카데미), 방문 상담을 먼저 받아보세요. 궁금한 점, 망설여지는 점, 꿈을 선택하는 데 대한 걱정 등을 성실히 상담해 드립니다.\r\n\r\n ', 0, 8, 1),
	(781, 'admin', '2021-06-28', '게임 기획 과정에서는 무엇을 배우나요?', '영어로 게임 기획은 Game Design, 즉 게임을 설계하는 업무입니다. 여러분은 좋은 게임을 설계하는 데 필요한 각종 전문 지식 뿐 아니라 게임 마케팅, QA 프로젝트 관리 기법, 개발 기술 등 주변 지식들 또한 함께 학습하게 됩니다.', 0, 8, 1),
	(782, 'admin', '2021-06-28', '게임 프로그래밍 과정에서는 무엇을 배우나요?', '게임 프로그래밍은 실제로 구동되는 결과물들을 만들어내는 업무입니다. 이를 위해 필요한 C, C++, C#, Java 등 기초 언어부터 자료 구조, 알고리즘, 게임 수학 등의 기초 학문, Cocos-2d나 Unity 3D 등의 게임 엔진까지 학습하게 됩니다.', 0, 8, 1),
	(783, 'admin', '2021-06-28', '기초 지식이 아무 것도 없는데 저도 배울 수 있나요?', '많은 학생들이 아무 지식도 없는 상태에서 들어와 현업인이 되어 졸업합니다. 단, 열정과 끈기는 여러분이 준비해 오셔야 합니다. 실제 취업 사례가 궁금하시다면 저희 학교의 취업 후기를 확인해 보세요.', 0, 8, 1),
	(784, 'admin', '2021-06-28', '어떤 분들이 가르치시나요?', '10년차 이상의 게임 기획자, 게임 프로그래머, 게임 PD 출신의 게임 업계 베테랑, 인디 게임 개발자, 게임 제작 관련 서적을 집필한 저자분들이 교수진으로 포진되어 있습니다. 또한 수많은 게임 현장의 현업인들이 저희의 뜻과 방향성에 공감해 다양한 형태로 교육에 도움을 주고 계십니다.', 0, 8, 1),
