	(946, 'admin', '2021-06-29', '경일게임아카데미 게임학원 취업률 1위', '<p><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">[G밸리뉴스 윤선미 기자] 경일게임아카데미가 다가오는 6월 8일 기업맞춤형 과정인 게임기획 과정을 업계 최초로 오픈한다. 이 기업맞춤형 과정은 2020년 고용노동부가 차세대 취업 성과 교육사업으로 첫 시행하여, 전국국비훈련기관 중 상위 10% 기관만이 신청이 가능한 과정이다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">그 중에서도 게임 콘텐츠 직종으로는 경일게임학원만이 게임교육업계 중 유일하게 기업맞춤형 기관으로 선정되었다. 금번 개강하는 기업맞춤형 게임기획과정은 타 아카데미와 큰 차별 점을 가지는데 다음과 같다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">■ 네코랜드 스튜디오 활용 게임개발</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">게임 기획자 직 군은 개임개발 중 컨트롤타워 역할을 맡고 있어 개발팀 내 모든 업무를 이해하는 것이 필요하다. 따라서 게임기획 직 군을 준비하는 경우 프로그래밍적 지식을 준비하는 것이 유리한데 이때 많은 게임 개발자 지망생들이 RPG만들기 툴 즉 알만툴 또는 쯔꾸르 등의 게임개발툴을 접하게 된다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">그런데 이런 게임개발툴은 대부분 외래 산인데 비해, 경일게임학원과 MOU를 체결한 넥슨의 협력업체 슈퍼캣에서 제작한 네코랜드는 국산형 RPG만들기 툴이며, 경일게임아카데미에서는 이 네코랜드를 이용하여 게임기획자 교육과정 중 일부 프로그래밍 교육을 함께 진행한다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">■ 게임 박람회 참관 및 참가</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">경일직업능력개발원이라는 명칭으로 지난 30년간 교육에 힘써온 경일게임아카데미는 게임교육업계에서도 훈련생들의 교육수준 향상과 취업을 위해 적극적으로 지원하는 곳으로 유명하다. 실제로 매년 플레이엑스포 및 G스타 그리고 넥슨의 취업박람회인 커리어클럽 또는 스마일게이트의 취업박람회 개최 시 빠짐없이 훈련생들과 동행하였고, 금번 기업맞춤형 교육을 맞아 더 극대화된 현장감 넘치는 게임개발의 장으로 훈련생들을 안내할 예정이라고 밝혔다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">■ 현장감이 반영된 협업 프로젝트</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">금번 기업맞춤형 교육의 여러 이점 중 가장 큰 장점은 바로 실무 맞춤형 협업 프로젝트를 필수 진행한다는 점이다. 기획 과정 및 프로그래밍 과정의 훈련생들은 과정 중 2개월간 실제로 출시를 목적 삼아 필수로 협업 프로젝트를 진행해야 하며, 이 단계를 통해 훈련생들은 협업에서의 소통 그리고 게임 출시 등의 현장감 넘치는 경험을 체험하게 된다. 실제로 게임개발사 면접 시, 협업 경험 여부 및 갈등해소 경험과 방법론에 대한 면접 질문은 필수로 나오기 때문에 취업에 더 직접적인 도움이 될 것으로 보인다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">■ 협약 기업 채용과 탄탄한 취업역량</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">기업맞춤형 교육의 승인심사조건은 고용노동부에서 인정한 우수훈련기관 중 10%만이 참여가 가능한데, 특히 취업률이 70% 이상이 되어야만 한다. 경일게임아카데미는 서울동부지역 게임컨텐츠직종 취업률 1위를 달성하며 이 과정을 승인 받았다. 이 과정의 주요 혜택 중에 하나는 협약기업과의 채용 연계가 가능하다는 점이다. 해당 과정 훈련 수료생들 중 25%는 채용이 확정되어 있어 확실한 취업이 가능하기에 많은 관심이 모이고 있다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">앞서 진행했던 과정들보다 더 큰 혜택을 제공하는 금번 기업맞춤형 게임기획 과정과 6월 하순에 오픈 되는 게임프로그래밍 과정은 수강료가 최대 11,793,600원 전액 국비지원이 가능하며, 그 외에도 교통비와 식비가 지원되며 교재 또한 훈련기관에서 제공하여 취업을 준비하는 훈련생들의 경제적인 부담을 크게 줄여줄 것으로 판단된다. 취업성공패키지 혹은 국민내일배움카드를 통해 수강이 가능하며, 수강을 하기 위해 국비 관련 진행이 약 1개월 가까이 소요되므로 빠른 문의 및 방문 상담이 필요하다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">경일게임아카데미 측은 “게임 교육 업계 최고 수준의 혜택으로 많은 관심이 모이는 만큼 상담은 사전 예약제로 운영되며 수강 등록은 선착순으로 지원되고 있으니 문의 및 지원은 홈페이지나 카카오톡 플러스 친구, 해당 홈페이지 등 다양한 채널로 진행하기를 바란다”고 전했다.</span><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><br style="box-sizing: inherit; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;"><span style="vertical-align: top; color: rgb(34, 34, 34); font-family: &quot;Noto Sans KR&quot;, &quot;Malgun Gothic&quot;, 돋움, dotum, &quot;Apple SD Gothic Neo&quot;, &quot;Helvetica Neue&quot;, Helvetica, Roboto, Arial, sans-serif; font-size: 16px;">출처 : G밸리(<a href="http://www.gvalley.co.kr%29/" style="vertical-align: top; cursor: pointer; color: rgb(102, 102, 102);">http://www.gvalley.co.kr)</a></span><br></p>', 1, 2, 1),
